import collections
import functools
import sys
sys.setrecursionlimit(10**9)

class Graph:
    def __init__(self):
        self.nodes = set()
        self.edges = collections.defaultdict(list)
        self.distances = {}

    def add_node(self, value):
        self.nodes.add(value)

    def add_edge(self, from_node, to_node, distance):
        self.edges[from_node].append(to_node)
        self.edges[to_node].append(from_node)
        self.distances[(from_node, to_node)] = distance


class Solution:
    def maxProbability(self, n: int, edges: list(list()), succProb: list, start: int, end: int) -> float:
        post = collections.defaultdict(list)
        prob_dict = collections.defaultdict(float)
        for i, (e1, e2) in enumerate(edges):
            post[e1].append(e2)
            post[e2].append(e1)
            prob_dict[(e1, e2)] = succProb[i]
            prob_dict[(e2, e1)] = succProb[i]
        seen = {start}
        prob = [1]
        ret = [0]
        store = [0] * n

        # print(post, prob_dict)
        def bfs(e):
            if prob[0] <= store[e]:
                return
            else:
                store[e] = max(store[e], prob[0])
            if prob[0] <= ret[0]:
                seen.add(e)
                return
            for p in post[e]:
                if p in seen or prob_dict[(e, p)] == 0:
                    continue
                else:
                    prob[0] = prob[0] * prob_dict[(e, p)]
                    if p == end:
                        ret[0] = max(ret[0], prob[0])
                    else:
                        seen.add(p)
                        bfs(p)
                        seen.remove(p)
                    prob[0] = prob[0] / prob_dict[(e, p)]

        bfs(start)
        return ret[0]


